Clinical significance of BRCA1 in breast and ovarian cancers {#S0001}
============================================================

Hereditary Breast and Ovarian Cancer (HBOC) is a syndrome resulting in an increased lifetime risk for developing breast and/or ovarian cancer. The genetic basis of HBOC is usually an inherited germline mutation in one allele of either the *BRCA1* or *BRCA2* genes and subsequent loss of heterozygosity in somatic tissues \[[@CIT0001]\]. Some of the trademarks of this syndrome include multiple family members with breast and/or ovarian cancer, personal history of both breast and ovarian cancer, development of breast or ovarian cancer at an early age, and family or personal history of male breast cancer \[[@CIT0001]\]. Mutations in *BRCA1* and *BRCA2* are responsible for the majority of HBOC cases \[[@CIT0001]\]. According to the literature, 10% of ovarian cancer cases and 3--5% of breast cancer cases are associated with *BRCA1* or *BRCA2* mutations \[[@CIT0001]\]. In the presence of a *BRCA1* mutation, women have a 70-80% lifetime risk of developing breast cancer and a 50% risk of developing ovarian cancer.

