Q:

Why is type_traits implemented using structs

Most of type traits are made using struct and template partial(or full) specialization. For example std::is_same is implemented as
template<typename>
struct is_same : false_type {};
template<typename T>
struct is_same<T, T> : true_type {}; // partial specialization

The usage would be
bool are_equal = std::is_same<T, U>::value;

or
.. = std::is_same_v<T, U>;

which are both a bit ugly. At first I thought it was the only solution then I found out that variables can also be partially specialized(while functions can not). Type transformation traits cannot (obviusly) be variables but for "information" traits why this wouldn't be better than a struct? template<typename>
inline constexpr bool is_same = false;
template<typename T>
inline constexpr bool is_same<T, T> = true;

And then
bool are_equal = std::is_same<T, U>;

A:

The reason is merely historical. Most type traits were added to the library first, in C++11. Variable templates were added later in C++14, and that point changing the implementation was unfeasible, since that is too backwards incompatible.

