Final-year medical students in Canada undergo an application process to obtain a training position within a post-graduate residency program. This process, colloquially known as "the match," is completed using the Canadian Residency Matching Service (CaRMs), a national not-for-profit, fee-for-service organization (www.carms.ca). Students apply to individual residency programs across Canada through CaRMs, which then distributes the applications to the residency programs. Residency programs then review the applications and invite select candidates for interviews. Both the candidate and program submit rank lists based on their desired programs or candidates, respectively. This process culminates in match day: applicants log onto the CaRMS system to find out which city and specialty to which they have matched. The result is legally binding; thus, a candidate does not have the legal right to withdraw from the match or residency program. Each year, a number of Canadian medical students are unmatched in the first iteration of CaRMS. By not being able to secure a residency position in Canada, unmatched students face a future in which they will not be able to practice medicine. On the surface, the consequence of not matching in the first iteration of CaRMs may not appear significant.

