Introduction {#S1}
============

Bioencapsulation technology has shown great promise for tissue engineering and cell-based therapies. First, bioencapsulation technology can be applied to cell encapsulation, helping to overcome the difficulties associated with immunorejection of transplanted tissues and cells ([@R1]--[@R4]). Traditional methods to avoid rejection involve use of immunosuppressive drugs that are not ideal for the health of the patient ([@R5]). The encapsulation of living cells in macroscale or microscale capsules provides a promising route for immunoisolation; the capsule's membrane protects the encapsulated cells from both the host's immune system and mechanical stresses, while allowing free diffusion of nutrients and metabolic waste to and from the encapsulated cells for their survival ([@R4]). Second, bioencapsulation technologies can be used for directed differentiation of stem cells for constructing different tissue types with high efficiency and specificity compared with 2D cell differentiation ([@R6]--[@R10]). Third, bioencapsulation technologies can be applied to cell cryopreservation to help resolve the issue of tissue preservation before transplantation ([@R4], [@R11]--[@R15]).
